import {
  Send,
  Bot,
  User,
  Activity,
  AlertCircle,
  CheckCircle,
  Clock,
  Globe,
  FileText,
  MessageSquare,
} from "lucide-react";

export const getEventIcon = (eventType) => {
  switch (eventType) {
    // User events
    case "user_notification":
    case "user_question":
      return <MessageSquare className="w-4 h-4 text-indigo-500" />;

    // Web operations
    case "web_search":
      return <Globe className="w-4 h-4 text-orange-500" />;
    case "web_search_result":
      return <Activity className="w-4 h-4 text-orange-500" />;
    case "web_navigation":
      return <Globe className="w-4 h-4 text-orange-600" />;
    case "web_navigation_result":
      return <Globe className="w-4 h-4 text-orange-600" />;

    // File operations
    case "file_read":
      return <FileText className="w-4 h-4 text-cyan-500" />;
    case "file_write":
      return <FileText className="w-4 h-4 text-green-600" />;
    case "file_replace":
      return <FileText className="w-4 h-4 text-yellow-600" />;
    case "file_find":
      return <FileText className="w-4 h-4 text-blue-500" />;
    case "file_explore":
      return <FileText className="w-4 h-4 text-blue-600" />;

    // Shell operations
    case "shell_exec":
      return <Activity className="w-4 h-4 text-purple-600" />;
    case "shell_view":
      return <Activity className="w-4 h-4 text-gray-600" />;
    case "shell_write":
      return <Activity className="w-4 h-4 text-yellow-600" />;

    // Image operations
    case "image_generation":
      return <Activity className="w-4 h-4 text-magenta-500" />;

    // Legacy event types (for backwards compatibility)
    case "connection_success":
      return <CheckCircle className="w-4 h-4 text-green-500" />;
    case "tool_result":
      return <Activity className="w-4 h-4 text-blue-500" />;
    case "agent_request":
      return <Bot className="w-4 h-4 text-purple-500" />;
    case "web_visit_page":
      return <Globe className="w-4 h-4 text-orange-600" />;
    case "user_send_message":
      return <MessageSquare className="w-4 h-4 text-indigo-500" />;
    case "shell_exec_command":
      return <Activity className="w-4 h-4 text-purple-600" />;
    case "completion":
      return <CheckCircle className="w-4 h-4 text-green-600" />;
    case "error":
      return <AlertCircle className="w-4 h-4 text-red-500" />;
    case "unknown":
    default:
      return <Clock className="w-4 h-4 text-gray-500" />;
  }
};
